import React from "react";
import './AppHeader.css'
import { NavLink} from "react-router-dom";


const AppHeader = (props) => {
    return (
        <div className='app-header'>
            <NavLink to="./main" className="app-title">Coffee Shop</NavLink>

            <tr className="table">
                <th><NavLink to={"/Main"} className="newMenu">Basket</NavLink></th>
                <th><NavLink to={"/profile"} className="newMenu">Profile</NavLink></th>

            </tr>
        </div>
    )
}

export default AppHeader
